import '../../../../../../presentationUser/attendance/facerecognation/index.dart';import '../../../../../../shared/components/base_stateless_widget.dart';import '../../../../data/models/vehicles_dto.dart';import '../../../../domain/entities/vehicle.dart';import '../../widgets/vehicles_item.dart';class VehiclesScreen extends BaseStatelessWidget {  final List<Vehicle> data;  final Function(int id) onDelete;  final Function() onRefresh;  VehiclesScreen({super.key, required this.data, required this.onDelete, required this.onRefresh});  @override  Widget build(BuildContext context) {    return ListView.builder(      itemCount: data.length,      itemBuilder: (context, index) =>          VehiclesItem(data: data[index], onDelete: onDelete, onRefresh: onRefresh),    );  }}